import './App.css';
import * as React from 'react';

const movies = [
  {
    title: 'Movie One',
    type: 'movie',
    episodes: 1,
    currentEp: 0,
  },
  {
    title: 'Series One',
    type: 'series',
    episodes: 13,
    currentEp: 1,
  },
];


const App = () => {


  return (
    <>
      <ul>
        <li>{movies.map((item) => {
          return (item.title);
        })}</li>
      </ul>
    </>
  );
};

export default App;
